import"./chunk-2R6CW7ES.js";var a={"Using the SnowflakeIDGenerator class":{Instantiate:"Instancie la clase <code>SnowflakeIDGenerator</code>","where machineId is":"d\xF3nde <code>machineId</code> es el n\xFAmero / identificador del sistema que est\xE1 intentando obtener un Id.","Starting on version 1.1.2023":"A partir de la versi\xF3n 1.1.2023 se le puede indicar al generador que use una fecha particular como <em>epoch</em> a partir de la cual se derivan las marcas temporales para la fecha actual.","Using the generator object":"Usando el objeto generador, hay 3 formas de obtener el c\xF3digo:","Call GetSnowflake":"Invoque a <code>generator.GetSnowflake()</code> para obtener un objeto <code>Snowflake</code>","Call GetCode":"Invoque <code>generator.GetCode()</code> para obtener un Id como n\xFAmero en formato (ulong)","Call GetCodeString":"Invoque <code>generator.GetCodeString()</code> para obtener un Id en formato string"},"Using the SnowflakeIDGenerator class as static":{"If you only need":"Si s\xF3lo desea obtener un \xFAnico Id, es m\xE1s f\xE1cil utilizar el generador como clase est\xE1tica.","The method names":"Los nombres de los m\xE9todos son los mismos que cuando se usa el generador, excepto que requeren el <code>machineId</code> como par\xE1metro:","Call GetSnowflake":"Invoque <code>SnowflakeIDGenerator.GetSnowflake(machineId)</code> para obtener un objeto <code>Snowflake</code>","Call GetCode":"Invoque <code>SnowflakeIDGenerator.GetCode(machineId)</code> para obtener un Id como n\xFAmero en formato (ulong)","Call GetCodeString":"Invoque <code>SnowflakeIDGenerator.GetCodeString(machineId)</code> para obtener un Id en formato string"},"Using a non-standard date as epoch":{"version 1.1.2023 and up":"versi\xF3n 1.1.2023 o superior","The first component of":"El primer componente de los c\xF3digos es el tiempo (en milisegundos) transcurridos desde un punto fijo en el tiempo, llamado <em>epoch</em> (\xE9poca). De forma predeterminada, el generador utiliza la \xE9poca UNIX (1\xB0 de enero de 1970, 12:00:00am) c\xF3mo punto a partir del cual empezar a contar.","Adding a DateTime":"Incluir un objeto <code>DateTime</code> como par\xE1metro extra al utilizar el generadoe permite cambiar el momento 0 desde el cu\xE1l se cuentan los milisegundos transcurridos."}};export{a as default};
